import React from 'react'

const Filter = ({FilterList}) => {
    const filter =  FilterList.map(filter => (
        <div style={{padding: '10px'}}>
            <button style={{padding: '10px'}}>{filter}</button>
        </div>
    ))

    return (
        <div>
            <div>Filters</div>
            <span>Launch Year</span>
            {filter}
        </div>
    )
}

export default Filter;
